using Microsoft.Xna.Framework;
using System;
using System.IO;
using System.Runtime.Serialization.Formatters.Binary;

namespace VecxMonoGame.Common
{
    public static class HardcodedRom
    {

        public static void getRom(Vectrex vectrex)
        {
            /* https://stackoverflow.com/questions/6292645/convert-binary-data-to-hex-in-shell-script
             * cat rom.dat | od -A n -v -t x1 | tr -d ' \n'
             * 
             */
            String rom = "";

            for (int i = 0; i < rom.Length / 2 && i < vectrex.rom.Length; ++i)
            {
                vectrex.rom[i] = Byte.Parse(rom.Substring(i * 2, 2), System.Globalization.NumberStyles.HexNumber);
            }
            //System.Console.WriteLine("rom.Length = " + (rom.Length / 2));
        }

        public static void getCart(Vectrex vectrex)
        {
            /* cat Bloxorz.bin | od - A n - v - t x1 | tr - d ' \n'
             * 
             */
            //String cart = "";

            //for (int i = 0; i < cart.Length / 2 && i < vectrex.cart.Length; ++i)
            //{
            //    vectrex.cart[i] = Byte.Parse(cart.Substring(i * 2, 2), System.Globalization.NumberStyles.HexNumber);
            //}
            //System.Console.WriteLine("cart.Length = " + (cart.Length / 2));

            int i = 0;
            using (var stream = TitleContainer.OpenStream("Content/Bloxorz.bin"))
            {
                while (true)
                {
                    int b = stream.ReadByte();
                    if (b < 0) break;
                    vectrex.cart[i++] = (byte)b;
                }
            }
        }
    }
}
